import React from "react";
function ExpenseItem() {
  return (
    <div>
      <div> May 11th 2021 </div>
      <div>
        <h2> Car Insurance </h2>
        <div> $294.67 </div>
      </div>
    </div>
  );
}

export default ExpenseItem;
